import React from 'react';
import './mainPageBody.css'

const mainPageBody = (props) => {
    return ( 
        <div className="mainPageBodyBackground">
            <div className="mainPageBodyCreamBoxLeft"></div>
            <div className="mainPageCenterBox">
                <div className="mainPageCenterBoxLeft"></div>
                <div className="mainPageCenterBoxRight">
                    <h2>Hello</h2>
                    <h4>Here's who I am and what I do</h4>
                    <div className="mainPageButtons">
                        <button className={'active'} style={{backgroundColor: 'rgb(57, 110, 255)', color: 'white'}}>Resume</button>
                        <button>Projects</button>
                    </div>
                    <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quidem id labore eum commodi iusto officia error corporis fugit nobis fuga numquam debitis, quod corrupti unde dolor aliquid vel exercitationem nesciunt dignissimos enim! Nisi, sint dolorem provident nemo consequatur, corporis, inventore nostrum tenetur quaerat at perspiciatis dolores omnis animi. Illum, vitae.</p>
                </div>
            </div>
        </div>
     );
}

export default mainPageBody;
